import { Lock, Mail, UserRound } from 'lucide-react'
import { useEffect, useState } from 'react'
import { Link } from 'react-router-dom'
import CustomForm from '../styles/CustomForm.module.css'
import styles from '../styles/RegistrationLogin.module.css'

export function Registration() {
	const [Email, setEmail] = useState('')
	const [Password, setPassword] = useState('')
	const [RePassword, setRePassword] = useState('')
	const [First_Name, setFirst_Name] = useState('')
	const [Last_Name, setLast_Name] = useState('')
	const [FormValid, setFormValid] = useState(false)

	const [EmailDirty, setEmailDirty] = useState(false)
	const [PasswordDirty, setPasswordDirty] = useState(false)
	const [RePasswordDirty, setRePasswordDirty] = useState(false)
	const [First_NameDirty, setFirst_NameDirty] = useState(false)
	const [Last_NameDirty, setLast_NameDirty] = useState(false)

	const [EmailError, setEmailError] = useState('Email не може бути пустим')
	const [PasswordError, setPasswordError] = useState(
		'Password не може бути пустим'
	)
	const [RePasswordError, setRePasswordError] = useState(
		'RePassword не може бути пустим'
	)
	const [First_NameError, setFirst_NameError] = useState(
		'First_Name не може бути пустим'
	)
	const [Last_NameError, setLast_NameError] = useState(
		'Last_Name не може бути пустим'
	)

	const blurHandler = e => {
		switch (e.target.name) {
			case 'Email':
				setEmailDirty(true)
				break
			case 'Password':
				setPasswordDirty(true)
				break
			case 'RePassword':
				setRePasswordDirty(true)
				break
			case 'First_Name':
				setFirst_NameDirty(true)
				break
			case 'Last_Name':
				setLast_NameDirty(true)
				break
		}
	}
	const EmailHandler = e => {
		setEmail(e.target.value)

		const re =
			/^(([^<>()[\]\.,;:\s@\"]+(\.[^<>()[\]\.,;:\s@\"]+)*)|(\".+\"))@(([^<>()[\]\.,;:\s@\"]+\.)+[^<>()[\]\.,;:\s@\"]{2,})$/i

		if (!re.test(String(e.target.value).toLowerCase())) {
			setEmailError('Email не правильний')
		} else {
			setEmailError('')
		}
	}
	const PasswordHandler = e => {
		setPassword(e.target.value)
		var re =
			/^(?![!@#$%^&*])[a-zA-Z0-9!@#$%^&*]*[0-9]+[a-zA-Z0-9]*[!@#$%^&*]+[a-zA-Z0-9]*$/

		if (e.target.value.length < 6 || e.target.value.length > 16) {
			setPasswordError(
				'Password має бути більшим за 6 символів і меншим за 16 '
			)

			if (!e.target.value) {
				setPasswordError('Password не може бути пустим')
			}
		} else if (!re.test(String(e.target.value))) {
			setPasswordError(
				'пароль не може  починатися зі спеціального символу,але все ще містив хоча б одну цифру і один спеціальний символ(!@#$%^&*) '
			)
		} else {
			setPasswordError('')
		}
	}
	const RePasswordHandler = e => {
		setRePassword(e.target.value)

		if (e.target.value != Password) {
			setRePasswordError('Паролі не збігаються')
		} else {
			setRePasswordError('')
		}
	}

	const First_NameHandler = e => {
		setFirst_Name(e.target.value)

		const re = /^[A-ZА-ЯІЇЄ][a-zа-яіїє]+(?: [A-ZА-ЯІЇЄ][a-zа-яіїє]+)?$/

		if (!re.test(String(e.target.value).toLowerCase())) {
			setFirst_NameError(
				"ім'я повинно містити тільки літери, перша літера може бути великою, а решта — маленькими, і можливий один пробіл між словами (якщо ім'я подвійне)."
			)
		} else {
			setFirst_NameError('')
		}
	}
	const Last_NameHandler = e => {
		setLast_Name(e.target.value)

		const re = /^[A-ZА-ЯІЇЄ][a-zа-яіїє]+(?: [A-ZА-ЯІЇЄ][a-zа-яіїє]+)?$/

		if (!re.test(String(e.target.value))) {
			setLast_NameError(
				"ім'я повинно містити тільки літери, перша літера може бути великою, а решта — маленькими, і можливий один пробіл між словами (якщо ім'я подвійне)."
			)
		} else {
			setLast_NameError('')
		}
	}
	useEffect(() => {
		if (EmailError || PasswordError) {
			setFormValid(false)
		} else {
			setFormValid(true)
		}
	}, [EmailError, PasswordError])
	return (
		<div className={styles.Container}>
			<div className={styles.RightBlock}></div>

			<div className={styles.LeftBlock}>
				<div className={styles.RegForm}>
					<div className={styles.RegFormLine}></div>
					<form action=''>
						<h1 className={styles.RegFormHeader}>Registration Form</h1>
						<div className={styles.RegFormBlock}>
							{EmailDirty && EmailError && (
								<div style={{ color: 'red' }}>{EmailError}</div>
							)}
							<div className={styles.RegFormBlock}>
								<Mail />
								<input
									className={CustomForm.CustomInput}
									type='Email'
									name='Email'
									value={Email}
									placeholder='Email'
									onBlur={e => blurHandler(e)}
									onChange={e => EmailHandler(e)}
								/>
							</div>
						</div>
						{PasswordDirty && PasswordError && (
							<div style={{ color: 'red' }}>{PasswordError}</div>
						)}
						<div className={styles.RegFormBlock}>
							<Lock />
							<input
								className={CustomForm.CustomInput}
								type='text'
								name='Password'
								value={Password}
								onBlur={e => blurHandler(e)}
								onChange={e => PasswordHandler(e)}
								placeholder='Password'
							/>
						</div>
						{RePasswordDirty && RePasswordError && (
							<div style={{ color: 'red' }}>{RePasswordError}</div>
						)}
						<div className={styles.RegFormBlock}>
							<Lock />
							<input
								className={CustomForm.CustomInput}
								type='Password'
								name='RePassword'
								value={RePassword}
								onBlur={e => blurHandler(e)}
								onChange={e => RePasswordHandler(e)}
								placeholder='Re-type password'
							/>
						</div>

						<div className={styles.RegFormBlockNames}>
							<div className={styles.RegFormBlock}>
								<UserRound />
								<input
									className={CustomForm.CustomInput}
									type='text'
									name='First_Name'
									value={First_Name}
									onBlur={e => blurHandler(e)}
									onChange={e => First_NameHandler(e)}
									placeholder='First Name'
								/>
							</div>
							<span className={styles.MarginNames}></span>
							<div className={styles.RegFormBlock}>
								<UserRound />
								<input
									className={CustomForm.CustomInput}
									type='text'
									name='Last_Name'
									value={Last_Name}
									onBlur={e => blurHandler(e)}
									onChange={e => Last_NameHandler(e)}
									placeholder='Last Name'
								/>
							</div>
						</div>

						<div className={styles.RegFormBlock}>
							<div>
								<input type='checkbox' id='conditions1' name='conditions' />
								<label>I agree with terms and conditions</label>
							</div>
						</div>
						<div className={styles.RegFormBlock}>
							<div>
								<input type='checkbox' id='conditions' name='conditions' />
								<label>I want to receive the newsletter</label>
							</div>
						</div>

						<div className={styles.RegFormBlock}>
							<button
								disabled={!FormValid}
								className={CustomForm.CustomButtonSubmit}
							>
								Register
							</button>
						</div>
					</form>
					<div className={styles.AfterForm}>
						<Link to={'/Login'}> Already have an account? </Link>
					</div>
				</div>
			</div>
		</div>
	)
}
